import React, { Component } from 'react';
import { buttons } from './buttons';

class ButtonsPanel extends Component {
  render() {
    return (
      <div>
        {buttons.map((buttonSign) => {
          return <Button sing={buttonSign} />;
        })}
      </div>
    );
  }
}
